const getGifs = (id) =>{

    const URL =`https://api.giphy.com/v1/gifs/${id}?api_key=zqIAta0tI3xnT63BqfCRC90on6dF2fg8` ;

    return fetch(URL)
    .then(response => response.json())
    .then(response => {
      const data = response.data;
      return data
    })
}


export default getGifs;
